var title_f25_34_26158="Approach hepatic hydrothorax";
var content_f25_34_26158=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F80148&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F80148&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Treatments for hepatic hydrothorax",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 441px; height: 415px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    All patients with confirmed hepatic hydrothorax should be referred for evaluation for liver transplantation. The first step in management is therapy with low sodium diet (70-90 meq/day) and diuretics (see topic review on diuretic therapy for ascites). If there is no response to diuretics, therapeutic thoracentesis of approximately 2 liters can be attempted followed by diuretics at lower doses if possible. If patients do not respond to diuretics or develop complications they can be considered to have hepatic hydrothorax and should be considered for TIPS placement. This measure may help as a bridge to liver transplantation. However, patients should be carefully selected. TIPS is best considered in patients younger than 60 years of age, without hepatic encephalopathy and/or those with Child A/B cirrhosis For patients that cannot undergo TIPS placement, consideration for pleurodesis or diaphragmatic repair by thoracoscopy should be considered. Chest tube placement should be avoided, as it is associated with severe complications.",
"    <div class=\"footnotes\">",
"     <br>",
"      * Furosemide 40 mg/day and spironolactone 100mg/day and if there is no response, diuretics may be increased in a stepwise fashion every 3-5 days by doubling doses (ratio of 40mg:100mg), furosemide up to 160 mg/day and spironolactone up to 400 mg/day.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
